цу. Этот шорткод покажет одиночные платежи и подписки для вошедшего пользователя','In order for Stripe to function completely for subscription/recurring payments, you must configure your Stripe webhooks. Visit your %1$saccount dashboard%2$s to configure them. Please add a webhook endpoint for the URL below.'=>'Чтобы Stripe полностью функционировал для подписок/регулярных платежей, вы должны настроить вебхуки Stripe. Посетите ваш %1$sпанель управления аккаунтом%2$s, чтобы настроить их. Пожалуйста, добавьте конечную точку вебхука для URL ниже.','FluentForms uses the pages below for handling the display of payment history and payment receipt. Please select the pages and add the instructed shortcodes accordingly. %1$sPlease read the documentation%2$s for advanced shortcode usage.'=>'FluentForms использует страницы ниже для отображения истории платежей и квитанций. Пожалуйста, выберите страницы и добавьте соответствующие шорткоды. %1$sПожалуйста, прочитайте документацию%2$s для продвинутого использования шорткодов.','Also %1$splease check the documentation%2$s to learn how to accept %3$sRecurring Payments%4$s'=>'Также %1$sпожалуйста, ознакомьтесь с документацией%2$s, чтобы узнать, как принимать %3$sРегулярные платежи%4$s','This will also %1$scancel the subscription at stripe.%2$s So no further payment will be processed.'=>'Это также %1$sотменит подписку в Stripe.%2$s Таким образом, дальнейшие платежи не будут обрабатываться.','%1$s has been refunded via %2$s at %3$s'=>'%1$s был возвращен через %2$s в %3$s','%1$s valid option of %2$s results'=>'%1$s действительный вариант из %2$s результатов','Drop file here or %1$sclick to upload%2$s'=>'Перетащите файл сюда или %1$sнажмите для загрузки%2$s','View More information about %1$sMask Library%2$s'=>'Посмотреть дополнительную информацию о %1$sБиблиотеке масок%2$s','%1$s Mask: %2$s. Valid Input: %3$s'=>'%1$s Маска: %2$s. Корректный ввод: %3$s','To unlock more features consider %1$supgrading to PRO%2$s.'=>'Чтобы разблокировать бол