umns]'=>'Далее [Сопоставить столбцы]','Next page'=>'Следующая страница','No data available yet'=>'Данные еще не доступны','Numbers of entries'=>'Количество записей','of'=>'из','of the following match:'=>'из следующих совпадений:','One time payment of {first_interval_total}'=>'Одноразовый платеж {first_interval_total}','Optimized API connection with Mail Service Providers'=>'Оптимизированное подключение API к провайдерам почтовых сервисов','paid'=>'оплачено','PayPal IPN Settings (Recommended for Subscription Payment)'=>'Настройки PayPal IPN (рекомендуется для платежей по подписке)','PayPal Standard'=>'PayPal Standard','Percentage of total submission and Total views'=>'Процент от общего количества отправок и общего числа просмотров','Please enable the following Webhook events for this URL'=>'Пожалуйста, включите следующие события вебхука для этого URL','Please generate API key and API secret using Cloudflare Turnstile'=>'Пожалуйста, сгенерируйте API-ключ и API-секрет с помощью Cloudflare Turnstile','Please install and active Flamingo'=>'Пожалуйста, установите и активируйте Flamingo','Please provide step attribute for this field.'=>'Пожалуйста, укажите атрибут шага для этого поля.','Please upgrade to PRO to unlock the feature.'=>'Пожалуйста, обновитесь до PRO, чтобы разблокировать эту функцию.','Please upgrade to pro to unlock this feature.'=>'Пожалуйста, обновитесь до PRO, чтобы разблокировать эту функцию.','Post type form is a Pro features'=>'Форма типа поста — это функция PRO','Preview Only'=>'Только предварительный просмотр','private'=>'частный','public'=>'публичный','Purchase Pro Add - On Now'=>'Приобрести Pro-дополнение сейчас','Quiz & Survey Forms'=>'Формы викторин и опросов','Read more about Cloudflare Turnstile.'=>'Узнать больше о Cloudflare Turnstile.','Real-Time Email Delivery'=>'Доставка электронной почты в реальном времени','recaptcha-placeholder'=>'recaptcha-placeholder','refund'=>'возврат','Resend Any Emails'=>'Повторно отправить любые письма','Reset For